import React,{ OriginalLogo } from "./OriginalLogo";

export const Box = () => {
  return (
    <div className="w-[211px] h-[55px]">
      <div className="fixed w-[211px] h-[55px] top-0 left-0">
        <div className="relative h-[55px]">
          <div className="absolute w-14 h-[55px] top-0 left-0 bg-[url(/whatsapp-image-2024-05-06-at-00-19-1.png)] bg-cover bg-[50%_50%]" />
          <OriginalLogo
            className="!h-[39px] !absolute !left-7 !w-[183px] !top-2"
            divClassName="!text-[#474747] !tracking-[-0.40px] !text-[42.7px] !font-bold ![font-family:'Puritan-BoldItalic',Helvetica] !left-[41px] !leading-[29.3px] !top-[3px]"
            hasHotFood={false}
            text="Bengkel Online"
            type="main"
          />
        </div>
      </div>
    </div>
  );
};
